import React from 'react';

const NotFound = () => {
    return (
        <div style={{color: 'red'}}>
            <h1>PAGE NOT FOUND , ERROR 404!!!</h1>
            <p>Please try again later !</p>
        </div>
    );
};

export default NotFound;
